link.script:
(function() {
    var month = 12;
    iii.semester = month == 1 ? 1
        : month <= 6 ? 2
        : month <= 9 ? 0 : 1;
    if (iii.semester > 0) {
        var hideOtherSemester = function() {
            var other = iii.semester == 1 ? 2 : 1;
            $('#breadcrumbs li.group-sem'
                    + other
                    + ':not(.group-sem'
                    + iii.semester + '):not(.active)')
                .hide();
        };
        $(document)
            .ready(hideOtherSemester)
            .on("contentUpdate.iii", hideOtherSemester);
    }
})();
